import React from 'react';
import Axios from 'axios'
import {store} from '../store'
import {withRouter} from 'react-router-dom'
import {connect} from 'unistore/react'

const url = 'https://api-us.faceplusplus.com/facepp/v3/compare?api_key=sDYn4R45akhLki48Uy5xVzdqdq9qMqqK&api_secret=3jsLZXkF3HdBDEniCXCnjrOoL-ZfPuTe'
class SignIn extends React.Component{
    changeInput = e => {
        console.warn("cek event target", e.target.value);
        console.warn('status login', this.props.is_login)
        this.setState({ [e.target.name]: e.target.value });
      };
    handleMasukan = (e) =>{
        const { namaPengguna, kataKunci } = this.props;
        const data = {
          username: namaPengguna,
          password: kataKunci
        };
        store.setState({
          'namaPengguna': data.username,
          'kataKunci': data.password
        });
    }
    render(){
        return(
            <div className='container'>
                <form onSubmit={e=> e.preventDefault(e)}>
                    <div className="form-group row">
                        <label for="inputEmail3" className="col-sm-4 col-form-label">Username</label>
                        <div className="col-sm-8">
                        <input type="text" name='userNameInput' onChange={e=>this.changeInput(e)} className="form-control" id="inputEmail3"/>
                        </div>
                    </div>
                    <div className="form-group row">
                        <label for="inputPassword3" className="col-sm-4 col-form-label">password</label>
                        <div className="col-sm-8">
                        <input type="text" name='userPasswordInput' onChange={e=>this.changeInput(e)} className="form-control" id="inputPassword3"/>
                        </div>
                    </div>
                    <div className="form-group row">
                        <div className="col-sm-12">
                        <button type="submit" onClick={this.cekFoto} className="btn btn-primary btn-block" >Cek Foto</button>
                        </div>
                        <div className="col-sm-12 py-1">
                        <button type="submit" onClick={this.handleLogin} className="btn btn-primary btn-block" data-dismiss="modal">Login</button>
                        </div>
                    </div>
                    {this.props.cekFotoStatus ? 
                    (<div className="col-sm-12">
                        <img src={this.props.fotoUrlInput} width={"100%"}/>
                    </div>) : (<div></div>)
                    }
                </form>
            </div>
        )
    }
}
export default connect('agung, daffa, hedy, pipit, userNameInput, fotoUrlInput, agungIsLogin, daffaIsLogin, hedyIsLogin, pipitIsLogin, cekFotoStatus'
)(withRouter(SignIn))
